import React from 'react';
import styled from 'styled-components';
import GitHubIcon from '@mui/icons-material/GitHub';
import LaunchIcon from '@mui/icons-material/Launch';

const StyledCard = styled.div`
  position: relative;
  margin-bottom: 20px;
  overflow: hidden;
  border-radius: 8px;
  transition: all 0.3s ease-in-out;

  @media (min-width: 1000px) {
    display: flex;
    height: 400px;
  }

  &:hover .project-description {
    opacity: 1;
    transform: translateY(0);
  }

  &:hover .cover {
    filter: brightness(1);
  }

  &:hover .project-details {
    opacity: 1;
    transform: translateY(0);
  }
`;

const CoverImage = styled.img`
  width: 100%;
  height: auto;
  filter: brightness(0.7);
  transition: filter 0.3s ease;

  @media (min-width: 1000px) {
    width: 50%;
    height: auto;
  }
`;

const ProjectTitle = styled.div`
  position: absolute;
  top: 10px;
  left: 10px;
  background-color: rgba(10, 25, 47, 0.85);
  color: #ffefd6;
  padding: 10px;
  border-radius: 4px;
  z-index: 10;

  @media (min-width: 1000px) {
    position: static;
    background-color: transparent;
    padding: 0;
  }
`;

const ProjectDetails = styled.div`
  background-color: #282c34;
  color: white;
  padding: 20px;
  border-radius: 0 0 8px 8px;
  opacity: 0;
  transform: translateY(100%);
  transition: all 0.3s ease-in-out;
  position: absolute;
  bottom: 0;
  width: 100%;

  @media (min-width: 1000px) {
    position: relative;
    background-color: transparent;
    color: #ccd6f6;
    opacity: 1;
    transform: none;
    padding: 20px;
    border-radius: 0 8px 8px 0;
    width: 50%;
  }
`;

const ProjectDetailsTitle = styled.div`
  display: none;

  @media (min-width: 1000px) {
    display: flex;
    flex-direction: column;
    align-items: flex-end;
  }
`;

const ProjectDetailsDescription = styled.div`
  display: none;

  @media (min-width: 1000px) {
    display: block;
    position: absolute;
    width: calc(60% - 20px);
    top: 50%;
    right: 0px;
    background-color: #282c34;
    color: black;
    padding: 20px;
    border-radius: 4px;
    transform: translateY(-50%);
  }
`;

const ProjectDetailsStack = styled.ul`
  list-style: none;
  padding: 0;
  display: none;

  @media (min-width: 1000px) {
    display: flex;
    flex-wrap: wrap;
    margin-top: 10px;
    color: white;
    position: absolute;
    bottom: 50px;
    right: 20px;

    li {
      font-size: 14px;
      margin-right: 15px;
      color: #8892b0;
    }
  }
`;

const ProjectLinks = styled.div`
  display: flex;
  align-items: center;
  margin-left: auto;

  a {
    color: #ccd6f6;
    margin-right: 10px;
    display: flex;
    align-items: center;

    &:hover {
      color: #64ffda;
    }

    svg {
      font-size: 1.5rem;
    }
  }
`;

const ProjectCard = ({ project }) => {
  return (
    <StyledCard>
      <CoverImage src={project.cover} alt={project.title} className="cover" />
      <ProjectTitle>
        <Typography variant="overline" style={{ color: '#ffefd6' }}>
          Featured Project
        </Typography>
        <Typography variant="h5" style={{ marginBottom: '10px' }}>
          {project.title}
        </Typography>
      </ProjectTitle>
      <ProjectDetails className="project-details">
        <ProjectDetailsTitle>
          <Typography variant="overline" style={{ color: '#ffefd6' }}>
            Featured Project
          </Typography>
          <Typography variant="h5" style={{ marginBottom: '10px' }}>
            {project.title}
          </Typography>
        </ProjectDetailsTitle>
        <ProjectDetailsDescription>
          <Typography variant="body1" style={{ marginBottom: '20px' }}>
            {project.description}
          </Typography>
        </ProjectDetailsDescription>
        <ProjectDetailsStack>
          {project.tech.map((tech, index) => (
            <li key={index}>{tech}</li>
          ))}
        </ProjectDetailsStack>
        <ProjectLinks>
          {project.github && (
            <a href={project.github} target="_blank" rel="noopener noreferrer">
              <GitHubIcon />
            </a>
          )}
          {project.external && (
            <a href={project.external} target="_blank" rel="noopener noreferrer">
              <LaunchIcon />
            </a>
          )}
        </ProjectLinks>
      </ProjectDetails>
    </StyledCard>
  );
};

const Typography = styled.p`
  margin: 0;
  color: ${({ variant }) => (variant === 'overline' ? '#f6f7f8' : '#f6f7f8')};
  font-size: ${({ variant }) => (variant === 'h5' ? '1.5rem' : variant === 'body1' ? '1rem' : '0.875rem')};
  text-transform: ${({ variant }) => (variant === 'overline' ? 'uppercase' : 'none')};
  font-weight: ${({ variant }) => (variant === 'h5' ? '600' : '400')};
  margin-bottom: ${({ variant }) => (variant === 'body1' ? '1rem' : '0')};
`;

export default ProjectCard;
